import React, { Component } from 'react';
import ListCards from './components/ListComponent'
class App extends Component {
  state = {monsters:[
    {name:'Isaj',id:1},
    {name:'mashi',id:2},
    {name:'yaqobal',id:3},
    {name:'dodpo',id:4},
    {name:'vivui',id:5},
    {name:'weu',id:6},
  ] }
  render() { 
    return ( <div>
      {this.state.monsters.map((x)=><h1 key={x.id}>{x.name}</h1>)}
      <ListCards>
      {this.state.monsters}
      </ListCards>
      </div> 
      );
  }
}

export default App;
